import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 8.9A-510 Effectiveness of filed record.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.9A-510.md","filePath":"vacode/8.9A-510.md"}'),o={name:"vacode/8.9A-510.md"},i=a('<h1 id="§-8-9a-510-effectiveness-of-filed-record" tabindex="-1">§ 8.9A-510 Effectiveness of filed record. <a class="header-anchor" href="#§-8-9a-510-effectiveness-of-filed-record" aria-label="Permalink to &quot;§ 8.9A-510 Effectiveness of filed record.&quot;">​</a></h1><p>(a) Filed record effective if authorized. A filed record is effective only to the extent that it was filed by a person that may file it under § <a href="http://law.lis.virginia.gov/vacode/8.9A-509/" target="_blank" rel="noreferrer">8.9A-509</a>.</p><p>(b) Authorization by one secured party of record. A record authorized by one secured party of record does not affect the financing statement with respect to another secured party of record.</p><p>(c) Continuation statement not timely filed. A continuation statement that is not filed within the six-month period prescribed by § <a href="http://law.lis.virginia.gov/vacode/8.9A-515/" target="_blank" rel="noreferrer">8.9A-515</a> (d) is ineffective.</p><p>2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP1007" target="_blank" rel="noreferrer">1007</a>.</p>',5),n=[i];function c(f,d,s,l,_,h){return t(),r("div",null,n)}const A=e(o,[["render",c]]);export{v as __pageData,A as default};
